Education, An (2009)  

Verenigd Koninkrijk
Drama
95 minuten

geregisseerd door Lone Scherfig
met Carey Mulligan, Peter Sarsgaard en Alfred Molina

Londen in de jaren '60. Jenny (Carey Mulligan) is een 16-jarig meisje. Wanneer de charmante dertiger David (Peter Sarsgaard) in haar buurt komt wonen, krijgt ze al snel een relatie met hem. Dit zet een serie gebeurtenissen in gang die van invloed zijn op Jenny haar verdere leven. Moet ze met David mee, of is het toch verstandiger dat ze aan haar toekomst denkt en haar geplande studie gaat volgen?

